script: |
  super -f text -I q135.spq | sort > q135.out

inputs:
  - name: q135.spq
    data: |
      SELECT DISTINCT - + 37 + + col1 AS col2 FROM tab0 (FORMAT parquet) WHERE ( ( col0 ) * - - col1 + + col1 ) NOT IN ( col0, ( + col0 ), + col0 );
  - name: tab0

outputs:
  - name: q135.out
    data: |
      -16
      -36
      44
